import '../css/Nav.css';

function Nav(){
    return (
      <div className="con-nav">
        <ul className="ul-nav">
          <li className="li-home"><a href="#service">Home</a></li>
          <li><a href="#service">Service</a></li>
          <li><a href="#service">About me</a></li>
        </ul>
      </div>
  );

}

export default Nav;
